async json => {
  const lines = json.csv.split('\n');
  return lines.map((line, i) => {
    if (line === '') return null;
    let [ url, object, json ] = line.split('\t');
    json = JSON.parse(json);
    return {url,object,json};
  }).filter(r => !!r);
}

async json => {
  const blobToBase64 = blob => {
    const reader = new FileReader();
    reader.readAsDataURL(blob);
    return new Promise(resolve => {
      reader.onloadend = () => {
        resolve(reader.result);
      };
    });
  };

  const blockIds = {
    'refrigerator': 'c312badd-7be4-4623-8e75-fa8f4f952916',
    'light-floor': '090efc1e-1709-46aa-b968-2714664443a0',
    'crop': '2d630ca5-f019-4249-9f8f-2e8ff27738bd',
    'annotated': 'c319e522-7a94-42e6-82fe-1d0f55f49f81',
  };

  const downloadAsDataUrl = async url => {
    const i = await fetch(url);
    const b = await i.blob();
    const image = await blobToBase64(b);

    return image;
  };

  const crop = async (image, bboxes) => {
    const cropped = await (new Promise(rs => sendMessage(blockIds['crop'], 'request-snapshot', {
      dataUrl: image,
      bboxes,
    }, data => rs(data))));

    return cropped.images;
  };

  const saveToDataset = async (images, object) => {
    for await (const image of images) {
      const output = await (new Promise(rs => sendMessage(blockIds[object], 'request-snapshot', {
        dataUrl: image.image,
      }, data => rs(data))));
    }

    return { success: true };
  };

  const cropAndSaveToDataset = async ({image, object, bboxes}) => {
    const croppedImages = await crop(image, bboxes);
    const output = await saveToDataset(croppedImages, object);

    return output;
  };

  const saveToAnnotatedDatasetWithOneLabel = async ({image, bboxes}) => {
    const output = await (new Promise(rs => sendMessage(blockIds['annotated'], 'request-snapshot', {
      dataUrl: image,
      bboxes,
    }, data => rs(data))));

    return { success: true };
  };

  // main
  const url = 'https://photos.zillowstatic.com/fp/096945bc8315809cfa9aa1ea5996dbc8-cc_ft_1536.jpg';
  const object = 'refrigerator';
  const bboxes = [{
    x: 100, y: 100, left: 0, top: 0, width: 200, height: 200,
  }, {
    x: 200, y: 200, left: 100, top: 100, width: 200, height: 200,
  }];

  const image = await downloadAsDataUrl(url);
  const output = await cropAndSaveToDataset({image, object, bboxes});
  const output2 = await saveToAnnotatedDatasetWithOneLabel({image, bboxes});

  return { output, output2 };
}
